import React from "react";
import "../App.css";

import { AppHeader } from "./AppHeader";
import { AppBody } from "./AppBody";
import { AppContainer } from "../state";

function App() {
  return (
    <AppContainer>
      {({
        mediaSelected,
        onMediaChange,
        watch,
        listen,
        onSearchQuery,
        setWatchData,
        setListenData
      }) => (
        <div className="App">
          <AppHeader />
          <AppBody
            mediaSelected={mediaSelected}
            onMediaChange={onMediaChange}
            onSearchQuery={onSearchQuery}
            setWatchData={setWatchData}
            setListenData={setListenData}
            watch={watch}
            listen={listen}
            // onSearchQuery={onSearchQuery}
          />
        </div>
      )}
    </AppContainer>
  );
}

export default App;
